Eigen::MatrixXd RotationEuler(float roll, float pitch, float yaw)
{
    Eigen::MatrixXd Rx(3,3), Ry(3,3), Rz(3,3), R(3,3);

    Rx << 1, 0, 0,
      0, cos(roll), -sin(roll),
      0, sin(roll), cos(roll);

    Ry << cos(pitch), 0, sin(pitch),
      0, 1, 0,
      -sin(pitch), 0, cos(pitch);

    Rz << cos(yaw), -sin(yaw), 0,
      sin(yaw), cos(yaw), 0,
      0, 0, 1;

    R = Rz*Ry;
    R = R*Rx;

    return R;
}

